import React from 'react';
import { render } from '@testing-library/react';

const navigationDetails = [
    {
        'itemName':'Home',
        'itemLink':'index.html'
    },
    {
        'itemName':'About Us',
        'itemLink':'about-us.html'
    },
    {
        'itemName':'Services',
        'itemLink':'service.html'
    }
]

const Nav = () => {
    return(
        navigationDetails.map((arrItems) => {
            console.log(arrItems);
        })
    )
}

export default Nav;
